package main

func MatchParens(lst []string) string {
    // Count parentheses from both strings
    leftCount := 0
    rightCount := 0

    for _, s := range lst {
        for _, ch := range s {
            if ch == '(' {
                leftCount++
            } else if ch == ')' {
                rightCount++
            }
        }
    }

    // Check if it's possible to balance the parentheses
    // We can balance them if the total left parentheses
    // are more than or equal to the right parentheses.
    if leftCount >= rightCount {
        return "Yes"
    }

    // If we can't balance it in any order, return "No"
    return "No"
}
